import React from 'react';
import "../styling/Search.css";
import LeftArrow from '../image/left-arrow.png';
import SearchbarOne from '../image/search-bar1.png';
import SearchbarTwo from '../image/search-bar2.png';


function Search() {
    return (
        <div className='main-body'>
            <>
                <img src={LeftArrow} className='left-arrow' alt="Arrow" />
                <div className='search-title'>Set Destination</div>
            </>
            <>
                
            <img src={SearchbarOne} className ='search-bar-one' alt="SearchbarOne" />
            <img src={SearchbarTwo} className ='search-bar-two' alt="SearchbarTwo" />

            </>
        </div>
    );
}

export default Search;
